import logo from "./img/DSC_7409.jpg"

import GlobalNav from "./GlobalNav";
import "./css/Header.css"
function Header({ onNav }) {
  return (
    <header>
      <img src={logo} className="header-logo" alt="logo of Spitfire propeller" onClick={onNav} href="/"/>
      <h1 className="header-title">

        Duxford Flying Day Review 'Commemorating D-Day' 
      </h1>
      <GlobalNav onNav={onNav} className="header-nav" />
    </header>
  );
}

export default Header;
